class HighQualityClass:
    """高質量的Python類示例"""

    def __init__(self, name: str):
        self.name = name

    def process(self, data: dict) -> dict:
        """處理數據的方法"""
        try:
            result = {"processed": True, "data": data}
            return result
        except Exception as e:
            return {"error": str(e)}

    def __str__(self) -> str:
        return f"HighQualityClass({self.name})"
